class AProject {
  contructor(name, desc, github, img){
    this.name = name;
    this.desc = desc;
    this.github = github;
    this.img = img;
  }
}

class MyProjectList {
  constructor(){
    this.list = [];

    this.list.push(
        {
          name:'exmaple',
          desc:'example',
          github:'https://github.com',
          img:'./imgs/star_background.jpg'
        }
    );

    this.list.push(
        new AProject('example2', 'example3', 'https://github.com', './imgs/star_background.jpg')
    );

    this.list.push(
        new AProject('example2', 'example3', 'https://github.com', './imgs/leaf_background.jpg')
    );
  }
}

export default MyProjectList;
